import React, { useState, useEffect } from "react";

const CanOpener = () => {
    const [participants, setParticipants] = useState([
        { name: "Red" },
        { name: "Blue" },
        { name: "Rue" },
    ]);
    return (
        <div>
            <form>
                <label htmlFor="nickName">Nickname</label>
                <input
                    type="text"
                    name="nickName"
                    value={participants.nickName}
                ></input>
                <input type="button" value="Add user"></input>
                {participants.map((value, index) => {
                    const participantId = `name-${index}`;
                    return (
                        <div key={`user-${index}`}>
                            <label htmlFor={participantId}>{`User #${
                                index + 1
                            }`}</label>
                            <input
                                type="text"
                                name={participantId}
                                data-index={index}
                                id={participantId}
                                className="name"
                            ></input>
                        </div>
                    );
                })}

                <ul></ul>
            </form>
        </div>
    );
};
export default CanOpener;
